ControlPropertyState.AutoRuleBindingString:
// PASTE THE NAME OF YOUR MENU TABLE HERE - ie 'MenuItems'
// ONLY EXPANDED BELOW DUE TO COMPONENT REQUIREMENT
//
// You can either pass a table in below that contains the values or the table itself.
// If you are listing values, you do not need to input all records within the table, only the used ones.
// ie below I have only passed in the values used by my component
//
// Action:
// "Display": Sets the output property "DisplayName" to the "Name" property,
// "Navigate": Navigates to the "Screen" screen,
// "Launch": Launches the "LaunchURL" in a new tab
// "Submenu": Displays or Hides the Submenu dropdown defined by the "SubmenuList" value
Table(
    {
        ID: 1,
        Name: "Home",
        ShowName: true,
        Tooltip: "Click here to return to the Home Screen",
        Icon: Icon.Home,
        ShowIcon: true,
        Action: "Navigate",
        Screen: App.ActiveScreen,
        LaunchURL: ""
    },
    {
        ID: 2,
        Name: "New",
        ShowName: false,
        Tooltip: "Click here to create a New Item",
        Icon: Icon.Add,
        ShowIcon: true,
        Action: "Submenu",
        SubmenuList: [
            {
                Name: "Item",
                Tooltip: "Click here to return to the Home Screen",
                Action: "Navigate",
                Screen: App.ActiveScreen,
                LaunchURL: ""
            },
            {
                Name: "Form",
                Tooltip: "Click here to return to the Home Screen",
                Action: "Display"
            }
        ]
    },
    {
        ID: 3,
        Name: "Settings",
        Tooltip: "Click here to access the App Settings",
        Icon: Icon.Settings,
        Screen: App.ActiveScreen
    }
)

// PASTE THE NAME OF YOUR FONT SIZES RECORD HERE - ie 'FontSizes'
// ONLY EXPANDED BELOW DUE TO COMPONENT REQUIREMENT
{
    TextMain:                       cmp_Menu_Horizontal_MS.ThisTheme.FontSize -1,
    TextEmphasis:                   cmp_Menu_Horizontal_MS.ThisTheme.FontSize +1,
    Content:                        cmp_Menu_Horizontal_MS.ThisTheme.FontSize +2,
    Title:                          cmp_Menu_Horizontal_MS.ThisTheme.FontSize +6,
    SubTitle:                       cmp_Menu_Horizontal_MS.ThisTheme.FontSize +4,
    AddPicture:                     cmp_Menu_Horizontal_MS.ThisTheme.FontSize -3
}
